// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import AdminDashboard from './Component/Dashboard/AdminDashboard/AdminDashboard';
import FleetPage from './Pages/Fleet/FleetPage'; // Example
import OilPage from './Pages/Oil/OilPage';       // Example
import CityOperation from './Pages/CityOperation/Cityoperation';
import LoginPage from './Pages/Auth/LoginPage';  // Example

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/fleet" element={<FleetPage />} />
        <Route path="/oil" element={<OilPage />} />
        <Route path="/city" element={<CityOperation />} />
        <Route path="/login" element={<LoginPage />} />
        {/* Add more routes as needed */}
      </Routes>
    </Router>
  );
};

export default App;
